import React, { useState } from "react";

export default function Login(props) {
    const [login, setLogin] = useState({
        username: '',
        password: ''
    })
    // How can we log in? What do we need to do?
    const handleChange = (e) => {
        setLogin({
            ...login,
            [e.target.name]: e.target.value
        })
    }

    return (
        <div>
            <h1>Welcome to the Safari App!</h1>
           <form>
           <input 
           type='text'
           name='username'
           label='username'
        //    value={}
        //    onChange={}
           className='input'>
           </input>

           <input 
           type='text'
           name='password'
           label='password'
        //    value={}
        //    onChange={}
           className='input'>
           </input>

        <button>Login</button>
        </form> 
        </div>
    )
}
